        xmlns="http://www.w3.org/2000/svg"
        className={_className}
        {...(height && { height: height })}
        {...(width && { width: width })}
        role="img"
        {...rest}
        ref={ref}
      >
        <use href={use}></use>
      </svg>
    ) : (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        viewBox={viewBox}
        className={_className}
        {...(height && { height: height })}
        {...(width && { width: width })}
        role="img"
        dangerouslySetInnerHTML={{ __html: titleCode + iconCode }}
